              "conclusion": "BACKGROUND INFORMATION: Statin Sensitivity SLCO1B1,                        1 Variant\n\nCHARACTERISTICS: Simvastatin is a commonly prescribed hypolipidemic drug used for cholesterol reduction and control. Approximately 1-5 percent of exposed individuals may experience a dose-dependent myopathy (skeletal muscle toxicity). Symptoms may include pain, muscle weakness, and cramps. The organic anion transporter polypeptide 1B1, encoded by SLCO1B1, transports active simvastatin acid from the blood stream into the liver. This test detects a common variant that reduces the function of the transporter, resulting in an increased plasma concentration of the drug. \n\nINHERITANCE: Autosomal co-dominant.  \n\nCAUSE: Simvastatin hypersensitivity reaction is strongly associated with the SLCO1B1*5 allele. The mechanism is related to changes in the activity of organic anion-transporter polypeptide 1B1 (OATP1B1). The *1 allele (normal transporter function) is presumed when the *5 allele is not detected.  One copy of the *5 allele predicts decreased transporter function; two copies of the *5 allele predicts poor transporter function.\n\nALLELE TESTED: SLCO1B1*5 (rs4149056, c.521T>C).\n\nALLELE FREQUENCY: Middle Eastern 5 percent, Caucasian 1-3 percent, African 0-2 percent, Asian 0-2 percent, Less than 1 percent in other populations.\n\nCLINICAL SENSITIVITY: Drug-dependent.\n\nMETHODOLOGY: Polymerase Chain Reaction (PCR) and Fluorescence Monitoring.\n\nANALYTICAL SENSITIVITY AND SPECIFICITY: Greater than 99 percent.\n\nLIMITATIONS: Only the targeted SLCO1B1 variant will be detected. Diagnostic errors can occur due to rare sequence variations. Risk of therapeutic failure or adverse reactions with statins may be affected by genetic and non-genetic factors that are not detected by this test. This result does not replace the need for therapeutic or clinical monitoring.Test developed and characteristics determined by ARUP \n\nLaboratories. See Compliance Statement C: aruplab.com/CS",
